  input: TEXT,F3XA,,"This is in response to the May 19, 2006 letter.  On Jan 6, 2006
    $30,000.00 was transferred from the non-federal account to cover allocated activity
    from Nov 9, 2005 until Jan 12, 2006.  That amount was miscalculated and caused
    an excess transfer of 1,943.71.  As soon as this was brought to our attention
    by the commission's letter we transferred the total excessive amount back to the
    non-federal account.  This will be reported on our June Monthly report.  The H1
    form was included with the amended February Monthly Report.  The Republican Party
    of Kentucky owns its building, therefore it holds no mortgage.      The Fundraising
    expenses did not promote, support or oppose a candidate for the 2006 Federal Election.  None
    of the other expenses were used to promote, support or oppose a candidate for
    the 2006 Federal Election. None of the expenditures were made on behalf of a Federal
    Candidate."
